Examples


Shows how to traverse a composite node's tree of child nodes. voidRecurseChildren()
{
autodoc=MakeObject<Document>(MyDir+u"Paragraphs.docx");

//Anynodethatcancontainchildnodes,suchasthedocumentitself,iscomposite.
ASSERT_TRUE(doc->get_IsComposite());

//Invoketherecursivefunctionthatwillgothroughandprintallthechildnodesofacompositenode.
TraverseAllNodes(doc,0);
}

voidTraverseAllNodes(SharedPtr<CompositeNode>parentNode,intdepth)
{
for(SharedPtr<Node>childNode=parentNode->get_FirstChild();childNode!=nullptr;childNode=childNode->get_NextSibling())
{
std::cout<<(String(u'\t',depth))<<Node::NodeTypeToString(childNode->get_NodeType());

//Recurseintothenodeifitisacompositenode.Otherwise,printitscontentsifitisaninlinenode.
if(childNode->get_IsComposite())
{
std::cout<<std::endl;
TraverseAllNodes(System::DynamicCast<CompositeNode>(childNode),depth+1);
}
elseif(System::ObjectExt::Is<Inline>(childNode))
{
std::cout<<"-\""<<childNode->GetText().Trim()<<"\""<<std::endl;
}
else
{
std::cout<<std::endl;
}
}
}

